BEGIN
	SELECT NAME INTO F1 FROM APP_USER WHERE ID = FOLLOWEE_ID ;
	SELECT NAME INTO F2  FROM APP_USER WHERE ID = FOLLOWER_ID ;
	MSG := F2 || ' is now following you ' ; 
	
	
END;
/

