PROCEDURE "C##PROJECT"."UP_NOTI" AS
BEGIN
	SELECT BLOG_TITLE INTO F1 FROM BLOG WHERE ID = BLOG_ID ;
	SELECT NAME INTO F2  FROM APP_USER WHERE ID = USER_ID ;
	SELECT USER_ID INTO RECEIVER FROM BLOG WHERE ID = BLOG_ID ;
	MSG := F2 || ' has upvoted your post titled  ' || F1 ; 

END;
/

